import './App.css';
import Navbar from './components/Navbar';
import Counters from './components/Counters';
import React from 'react';

class App extends Component {
  render() { 
    return (
      <React.Fragment>
        <Navbar />
        <div className='container'>
          <Counters />
        </div>
      </React.Fragment>
    );
  }
}

export default App;
